import React, { useState } from 'react';
import { Card, ListGroup, Form, Button, Alert } from 'react-bootstrap';

function Curriculo() {
  const [empresa, setEmpresa] = useState('');
  const [cargo, setCargo] = useState('');
  const [anoInicio, setAnoInicio] = useState('');
  const [anoFim, setAnoFim] = useState('');
  const [curriculo, setCurriculo] = useState([]);
  const [error, setError] = useState('');

  const handleAddExperience = () => {
    if (!empresa || !cargo || !anoInicio) {
      setError('Todos os campos são obrigatórios!');
      return;
    }
    setError('');
    setCurriculo([
      ...curriculo,
      { empresa, cargo, anoInicio, anoFim }
    ]);
    setEmpresa('');
    setCargo('');
    setAnoInicio('');
    setAnoFim('');
  };

  return (
    <div className="mt-5 pt-5">
      <Card>
        <Card.Header as="h5">EXPERIÊNCIA</Card.Header>
        <ListGroup variant="flush">
          <ListGroup.Item>
            <strong>Empresa:</strong>
            <Form.Control
              type="text"
              placeholder="Digite o nome da empresa"
              value={empresa}
              onChange={(e) => setEmpresa(e.target.value)}
            />
          </ListGroup.Item>
          <ListGroup.Item>
            <strong>Cargo:</strong>
            <Form.Control
              type="text"
              placeholder="Digite o cargo"
              value={cargo}
              onChange={(e) => setCargo(e.target.value)}
            />
          </ListGroup.Item>
          <ListGroup.Item>
            <strong>Ano de Início:</strong>
            <Form.Control
              as="select"
              value={anoInicio}
              onChange={(e) => setAnoInicio(e.target.value)}
            >
              <option value="">Selecione o ano</option>
              {Array.from({ length: 25 }, (_, index) => 2000 + index).map((ano) => (
                <option key={ano} value={ano}>{ano}</option>
              ))}
            </Form.Control>
          </ListGroup.Item>
          <ListGroup.Item>
            <strong>Ano de Término:</strong>
            <Form.Control
              as="select"
              value={anoFim}
              onChange={(e) => setAnoFim(e.target.value)}
            >
              <option value="">Selecione o ano (ou deixe em branco se atual)</option>
              {Array.from({ length: 25 }, (_, index) => 2000 + index).map((ano) => (
                <option key={ano} value={ano}>{ano}</option>
              ))}
            </Form.Control>
          </ListGroup.Item>
          {error && <Alert variant="danger">{error}</Alert>}
          <ListGroup.Item>
            <Button variant="primary" onClick={handleAddExperience}>Cadastrar Currículo</Button>
          </ListGroup.Item>
        </ListGroup>
      </Card>

      <Card className="mt-3">
        <Card.Header as="h5">Currículos Cadastrados</Card.Header>
        <ListGroup variant="flush">
          {curriculo.length > 0 ? (
            curriculo
              .sort((a, b) => b.anoInicio - a.anoInicio) // Ordenando por ano de início
              .map((item, index) => (
                <ListGroup.Item key={index}>
                  <strong>Empresa:</strong> {item.empresa} | <strong>Cargo:</strong> {item.cargo} |
                  <strong> Ano de Início:</strong> {item.anoInicio} |
                  <strong> Ano de Término:</strong> {item.anoFim || 'Atualmente'}
                </ListGroup.Item>
              ))
          ) : (
            <ListGroup.Item>Sem experiências cadastradas ainda.</ListGroup.Item>
          )}
        </ListGroup>
      </Card>
    </div>
  );
}

export default Curriculo;
